import React from 'react';

const Entertainment = () => {
return (
	<div
	style={{
		display: 'flex',
		justifyContent: 'Right',
		alignItems: 'Right',
		height: '100vh'
	}}
	>
	<h1>GeeksforGeeks is a Computer Science portal for geeks.</h1>
	</div>
);
};

export default Entertainment;
